export class SearchHeaderQHtmlBox{_UrlContent

    Name

    constructor(n){this.Name=this.constructor.name;let i="/PageComponents/"+this.Name,t=document.createElement("link");t.setAttribute("rel","stylesheet");t.setAttribute("href",i+"/style"+n+".css");document.head.append(t);this._UrlContent=i+"/content"}InsertAdjacentHTML(n,t,i){let r='<div id="'+this.Name+'">    <input type="text" placeholder="'+i+'" />    <a>        <img src="'+this._UrlContent+'/search.png" />    <\/a><\/div>';n.insertAdjacentHTML(t,r)}}